import React, { useState } from 'react';
import axios from 'axios';
import './SignUp.css';

function SignUp() {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
  });

  const [error, setError] = useState('');
  const [message, setMessage] = useState('');

  // Handle input change
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.id]: e.target.value });
  };

  // Handle signup submission
  const handleSignUp = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:8081/auth/signup', formData);
      setMessage(response.data);
      setError('');
    } catch (err) {
      if (err.response) {
        // Server responded with an error (4xx or 5xx)
        setError(err.response.data.message || 'Server error occurred during signup.');
      } else if (err.request) {
        // Request was made but no response received
        setError('No response from server. Please check your connection.');
      } else {
        // Other unknown error
        setError('Error occurred signing up: ' + err.message);
      }
      setMessage('');
    }
  };
  

  // Handle Google Sign-In (Placeholder for OAuth integration)
  const handleGoogleSignIn = () => {
    window.location.href = "https://accounts.google.com/o/oauth2/auth?...";  // Replace with actual OAuth URL
  };

  return (
    <section className="signup-container">
      {/* Content Section */}
      <div className="content-section">
        <div className="content-wrapper">
          <img src="/images/smileShop.png" alt="ZAPriceFinder Logo" className="brand-logo" />
          <h1><span>ZAPriceFinder!!!</span> Making your online shopping easier.</h1>
          <p className="section-paragraph">Find the best prices across multiple stores in seconds.</p>
        </div>
      </div>

      {/* Login Form Section */}
      <div className="form-section">
        <div className="form-wrapper">
          <h2>Welcome to <strong><span className='changeColor'>ZAPriceFinder</span></strong></h2>
          <br></br>
          <p>Enter your credentials to access your account.</p>
          <br></br>

          {/* Form */}
          <form onSubmit={handleSignUp}>
            <div className="input-container">
              <div className="form-group">
                <label htmlFor="username">Username</label>
                <input placeholder="Enter a username" type="text" id="username" value={formData.username} onChange={handleChange} required />
              </div>
            </div>
            <div className="input-container">
              <div className="form-group">
                <label htmlFor="email">Email</label>
                <input placeholder="Enter your email" type="email" id="email" value={formData.email} onChange={handleChange} required />
              </div>
            </div>
            <div className="input-container">
              <div className="form-group">
                <label htmlFor="password">Password</label>
                <input placeholder="Enter password" type="password" id="password" value={formData.password} onChange={handleChange} required />
              </div>
            </div>
            <br></br>
            <div className="remember-forgot">
              <div className="remember-me">
                <input type="checkbox" id="remember-me" />
                <label htmlFor="remember-me">Remember me</label>
              </div>
              <a href="#">Forgot password?</a>
            </div>

            <button type="submit" className="login-btn">Log In</button>
          </form>

          {/* Display Error or Success Messages */}
          {error && <p className="error-message">{error}</p>}
          {message && <p className="success-message">{message}</p>}

          <div className="divider">or</div>

          {/* Google Sign-In */}
          <button className="google-signin" onClick={handleGoogleSignIn}>
            <img src="/images/googleSVG.png" alt="Google Icon" className="google-icon" />
            <span>Sign in with Google</span>
          </button>
        </div>
      </div>
    </section>
  );
}

export default SignUp;
